import React, {useEffect, useState,} from 'react';
import { useParams } from "react-router-dom"



const Dima = () => {
    let {slug} = useParams()
    const [users, setUsers] = useState([])
    const fetchData = async () => {

      const response = await fetch("http://localhost:8000/api/posts/"+slug)
      const data = await response.json()
      setUsers(data)
      }




  useEffect(() => {
    fetchData()
  }, [])


    return (

        <div>        

                <ul>

                        <li key={users.id}>{users.title} @ {users.slug}

                        <h3>ID: {slug}</h3>



   <img src={users.header_image.url} 
   alt={users.header_image.alt} 
   width={users.header_image.width} 
   height={users.header_image.height} />





                        </li>


                </ul>

    </div>
  )
}



  export default Dima;
